&quot;The rear planisphere, [not shown here] similar in size to the one in the front but strictly circular, displays the brightest stars of the main circumpolar constellations (Ursa Major, Ursa Minor, and Cassiopeia). It is centred on the north celestial pole and, with its encircling silvered ring of 24-hour intervals, rotates once a sidereal day relative to a fixed meridian-index.&quot;

Source: Wikipedia article &quot;York Minster astronomical clock&quot;

