...&quot;19. Österreichischer Knappen- und Hüttentag in der Bergstadt Voitsberg.&quot;

Der Kalpak:
Die Schachtmütze oder auch der Kalpak (Tschako) vervollständigt die Tracht des Bergmannes. Der Kalpak ist mit einem ca. 18 cm hohen Federbusch ausgestattet, der auf Grund seiner Farbe eine Zuordnung ermöglichte. weiß: Erz- und Kohle, grün: Stahlgewinnung, blau: Stahlverarbeitung, schwarz: Salz rot: Magnesit. Dies muss jedoch nicht immer zwingend zutreffen! Die Bergmannstracht wird heute bei festlichen Anlässen (Barbarafeier, Fronleichnam etc.) getragen und ist ein Grundpfeiler des bergmännischen Brauchtums. Sie steht für die Zugehörigkeit, die Kameradschaftlichkeit und den Zusammenhalt der Bergleute!

