&quot;This clock, in the North Transept, was made by Henry Hindley in 1750. The two striking figures below the clock are 'Gog' and 'Magog'.&quot; 

Source: BBC website (bbc.co.uk), article &quot;Tick tock - York's clocks&quot; (28 October 2014)

dcc

The tomb is made of Purbeck marble. 

&quot;The recumbent figure of the departed Prelate lies upon a raised tomb, the mitred head resting on a cushion. He is dressed in the pontifical robes, but without the pall; his right hand is raised in the act of blessing: he treads on a dragon, into the mouth of which his pastoral staff is thrust with his left hand.&quot;

Sources:

Website &quot;Geograph&quot; (geograph.org), image &quot;SE6052 : Tomb of Walter de Gray, York Minster&quot;

&quot;An Historical &amp; Descriptive Guide to York Cathedral and Its Antiquities,&quot; by Geo. Ayliffe Poole and J. W. Hugall, Robert Sunter, 1850 (pp. 160-1)

