West side of the south transept.

&quot;Saint George's Chapel was the third regimental chapel to be created. It was to the Prince of Wales' own West Yorkshire Regiment. The regimental colours hang in the Chapel. The kneelers, depicting the badge of the regiment, the white horse and the Prince of Wales' plumage, were made by the Minister Broderers.&quot;

Source: website &quot;geograph&quot; (geograph.org.uk), page &quot;SE6052 : St George's chapel, York Minster&quot;

dcc

&quot;The restoration in 1967–8 of the tomb of Archbishop Walter de Gray in the south transept of York Minster was undertaken during the general programme of restoration of the Minster as a whole. The dismantling of the tomb afforded an opportunity to open the underlying coffin and examine its contents. Both coffin and contents proved to be of outstanding interest ...&quot;

Source: extract of an article from the journal &quot;Archaeologia,&quot; Vol. 103, 1971 (pp, 101-47); the extract was found on the Cambridge University Press website (Cambridge Core).

