The entire structure is not visible in this photo. The bar (gate into the city) has been damaged, rebuilt, and restored on a number of occasions over the centuries. Some parts apparently go back to the 12th century, but most of the existing structure was originally built in the 14th century.

Source: Wikipedia entry &quot;York city walls&quot;

