Inside the old Victorian Prison in Lincoln.

From <a href='https://www.lincolncastle.com/content/victorian-prison' rel='noreferrer nofollow'>www.lincolncastle.com/content/victorian-prison</a>

&quot;Men, women and children as young as eight were held here from 1848 to 1878 for crimes ranging from stealing a waistcoat and Bible, to highway robbery and murder. During this time seven murderers were hanged at the castle and their bodies buried in Lucy Tower where their graves can still be seen today.&quot;
